window.bookSummaryJSON = "<p><b>Black Dog, book one</b> </p> <p>Half-bloods with Thierry's skill set are given two options. They can join the conclave's marshal program, or they can pack their bags. Turn down the job offer, and you've just shredded your residency pass for the mortal realm and booked yourself a one-way ticket to Faerie. </p> <p>Texas is the only home Thierry has ever known, and she's not going anywhere - even if it means following in her notorious father's footsteps as a peacekeeper. But pinning on the badge opens her eyes to the fact sometimes fae need protection, too, and that sometimes humans are the real monsters. </p>"; 
